  false,\n\t\"url\": null,\n\t\"notes\": \"In response to the challenge of managing
  a large-scale environmental cleanup while maintaining sensitivity towards natural
  resources, the Department of the Army, the U.S. Fish and Wildlife Service (Service)
  and other agencies, have entered into a series of agreements designed to effectively
  manage and promote wildlife resources at Rocky Mountain Arsenal. This Cooperative
  Agreement for the Conservation and Management of Fish and Wildlife Resources at
  Rocky Mountain Arsenal (Conservation Agreement) establishes the Rocky Mountain Arsenal
  Field Office (RMA) of the U.S. Fish and Wildlife Service. The Conservation Agreement
  defines the roles and responsibilities of Department of the Army and the Service
  in managing wildlife throughout the entire area of RMA.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
